import React, { Component } from 'react';

export default class RolePlayScoreAddModal extends Component {
  constructor(props) {
    super(props);
    this.state = {
      feedback: '',
      score: '',
      roleName: '',
      roleDetails: [],
    }
  }

  componentDidMount() {
    this.getRoleDetails();
  }
  getRoleDetails = () => {
    const url = this.props.url_training.GET_ROLE_FOR_SCORE_ADD_SCREEN;
    this.props.ajaxUtil.sendRequest(url, {
      training_schedule_id: this.props.scheduleId,
      user_id: parseInt(this.props.selectedUser)
    }, roleDetails => {
      if (roleDetails.data.length > 0) {

        this.setState({ roleDetails: roleDetails.data })
      }

    }, this.props.loadingFunction,
      { method: 'POST', isShowSuccess: false });
  }

  handleChange = (event) => {
    this.setState({ [event.currentTarget.name]: event.currentTarget.value })
  }
  resetForm = () => {
    this.setState({
      feedback: '',
      score: '',
      roleName: '',
    });
  }
  saveRoleScore = () => {
    if (this.state.score.length < 0 || this.state.score <= 0 || this.state.score > 100) {
      this.props.setNotification({
        message: 'Invalid Score',
        hasError: true,
        timestamp: new Date().getTime()
      });
      return;
    }
    const url = this.props.url_training.SAVE_ROLE_SCORE;
    this.props.ajaxUtil.sendRequest(url, {
      training_role_id: parseInt(this.state.roleName),
      user_id: parseInt(this.props.selectedUser),
      score: parseInt(this.state.score),
      feedback: this.state.feedback
    }, response => {
      this.props.setNotification({
        message: response.message,
        hasError: !response.status,
        timestamp: new Date().getTime()
      });
      this.props.closeModal();
      if (response.status) {
        this.props.closeModal();
      }

    }, this.props.loadingFunction,
      { method: 'POST', isShowSuccess: false });
  }
  render() {
    return (
      <div className="container-fluid h-100">
        <div className="row d-flex justify-content-between h-100">
          <div className="col-md-12">
            <div className="form-group mb-30">
              <label>Role Name</label>
              <select
                value={this.state.roleName}
                onChange={(event) => this.handleChange(event)}
                className="form-control required"
                name="roleName">
                <option value="">Please Select</option>
                {this.state.roleDetails.map((role, index) => (
                  <option value={role.id}>{role.role}</option>
                ))}
              </select>
            </div>
            <div className="form-group mt-30">
              <label htmlFor="Training">Feedback</label>
              <textarea
                value={this.state.feedback}
                name="feedback"
                className="form-control"
                onChange={this.handleChange}
                rows="3"
                placeholder="Scoring Parameter"></textarea>
            </div>
            <div className="form-group mt-30">
              <label htmlFor="Training">Score Obtained</label>
              <div className="score_obtained_wraper">
                <div className="obtain">
                  <input
                    type="number"
                    min="0"
                    max="100"
                    name="score"
                    value={this.state.score}
                    onChange={this.handleChange}
                    className="form-control required"
                    placeholder="Enter Score" />
                </div>
                <div className="obtain">
                  <div className="obtain_content text-primary">
                    Out of 100
                  </div>
                </div>
              </div>

            </div>
          </div>
          <div className="col-md-12 align-self-end text-right">
            <div className="modal__footer__wrap">
              <button type="button" className="btn btn-danger cancel hide" onClick={this.props.closeModal} >Cancel</button>
              <button type="button" className="btn btn-danger reset hide" onClick={this.resetForm}>Reset</button>
              <button type="button" className="btn btn-danger add hide" onClick={this.saveRoleScore}>Add</button>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
